import React, { useState } from 'react';
import { View, Text, StyleSheet, ImageBackground, Picker, Image, TouchableOpacity } from 'react-native';
import { useNavigation } from '@react-navigation/native'; // Import the necessary hook
import Navbar from './NavBar';

const HomeScreen = () => {
  const navigation = useNavigation(); // Use the hook to get the navigation object
  const [selectedCarModel, setSelectedCarModel] = useState('');
  const [selectedPriceRange, setSelectedPriceRange] = useState('');
  const [selectedCity, setSelectedCity] = useState('');
  const [visibleProducts, setVisibleProducts] = useState(4);

  const products = [
    { id: 1, name: "Product 1", price: 49.99, city: "Karachi", image: require('../assets/carLandingImage.jpg') },
    { id: 2, name: "Product 2", price: 59.99, city: "Lahore", image: require('../assets/carLandingImage.jpg') },
    { id: 3, name: "Product 3", price: 49.99, city: "Karachi", image: require('../assets/carLandingImage.jpg') },
    { id: 4, name: "Product 4", price: 59.99, city: "Lahore", image: require('../assets/carLandingImage.jpg') },
    // Add more products as needed
  ];

  const showMoreProducts = () => {
    setVisibleProducts((prevVisibleProducts) => prevVisibleProducts + 4);
  };

  const navigateToDetail = (product) => {
    navigation.navigate('Detail', { product });
  };

  return (
    <View style={styles.container}>
      <ImageBackground source={require('../assets/blueBackground.jpg')} style={styles.backgroundImage}>
        <Navbar />
        <View style={styles.landingContainer}>
          <View style={styles.textContainer}>
            <Text style={styles.mainTitle}>Find Used Cars in Pakistan</Text>
            <Text style={styles.subtitle}>With thousands of cars, we have just the right one for you</Text>
          </View>
        </View>
        {/* Search Bar */}
        <View style={styles.searchContainer}>
          <Picker
            selectedValue={selectedCarModel}
            style={styles.picker}
            onValueChange={(itemValue) => setSelectedCarModel(itemValue)}
          >
            <Picker.Item label="Select Car Model" value="" />
            <Picker.Item label="Sedan" value="Sedan" />
            <Picker.Item label="SUV" value="SUV" />
          </Picker>
          <Picker
            selectedValue={selectedPriceRange}
            style={styles.picker}
            onValueChange={(itemValue) => setSelectedPriceRange(itemValue)}
          >
            <Picker.Item label="Select Price Range" value="" />
            <Picker.Item label="$0 - $10,000" value="$0 - $10,000" />
            <Picker.Item label="$10,000 - $20,000" value="$10,000 - $20,000" />
          </Picker>
          <Picker
            selectedValue={selectedCity}
            style={styles.picker}
            onValueChange={(itemValue) => setSelectedCity(itemValue)}
          >
            <Picker.Item label="Select City" value="" />
            <Picker.Item label="Karachi" value="Karachi" />
            <Picker.Item label="Lahore" value="Lahore" />
          </Picker>
        </View>
      </ImageBackground>

      {/* Display Product Cards */}
      <View style={styles.productContainer}>
  {products.slice(0, visibleProducts).map((product) => (
    <TouchableOpacity key={product.id} onPress={() => navigateToDetail(product)} style={styles.productCard}>
      <Image source={product.image} style={styles.productImage} />
      <Text style={styles.productName}>{product.name}</Text>
      <Text style={styles.productPrice}>Price: ${product.price}</Text>
      <Text style={styles.productCity}>City: {product.city}</Text>
    </TouchableOpacity>
  ))}
</View>

      {visibleProducts < products.length && (
        <TouchableOpacity onPress={showMoreProducts} style={styles.showMoreButton}>
          <Text style={styles.showMoreButtonText}>Show More</Text>
        </TouchableOpacity>
      )}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // backgroundColor: 'rgba(255, 255, 255, 0.7)', // Use rgba for transparent background
  },
  backgroundImage: {
    flex: 1,
    resizeMode: 'cover',
    justifyContent: 'center',
  },
  landingContainer: {
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
    marginTop: 100,
  },
  textContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  mainTitle: {
    fontSize: 35,
    fontWeight: 'bold',
    textAlign: 'center',
    marginBottom: 16,
    color: '#000',
  },
  subtitle: {
    fontSize: 16,
    textAlign: 'center',
    marginBottom: 8,
    color: '#000',
  },
  searchContainer: {
    marginTop: 16,
    width: '80%', // Adjust the width as needed
    alignSelf: 'center', // Center the search container
  
    borderRadius: 8,
    padding: 16,
  },
  picker: {
    height: 40,
    borderWidth: 1,
    borderRadius: 8,
    marginBottom: 8,
  },

  showMoreButton: {
    backgroundColor: 'rgba(255, 255, 255, 0.8)',
    padding: 10,
    borderRadius: 8,
    alignSelf: 'center',
    marginTop: 10,
  },
  showMoreButtonText: {
    color: '#000',
    fontWeight: 'bold',
  },

  productContainer: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    marginTop: 16,
  },
  productCard: {
    width: '45%',
    height: 250, // Adjust the height as needed
    marginVertical: 8,
  },
  cardBackground: {
    flex: 1,
    borderRadius: 8,
    overflow: 'hidden',
  },
  productImage: {
    width: '100%',
    height: '70%', // Adjust the height as needed
    borderRadius: 8,
  },
  productName: {
    fontSize: 16,
    marginVertical: 4,
    color: '#000',
    textAlign: 'center',
  },
  productPrice: {
    fontSize: 14,
    marginBottom: 4,
    color: '#555',
    textAlign: 'center',
  },
  productCity: {
    fontSize: 14,
    color: '#555',
    textAlign: 'center',
  },
});

export default HomeScreen;
